$(document).ready(function(){var e=1;var t=5;var n=25;$(".table").hide();var r="http://olympics.clearlytech.com/api/v1/medals";$.getJSON("http://whateverorigin.org/get?url="+encodeURIComponent(r)+"&callback=?",function(r){var i=$.parseJSON(r.contents);for(var s=0;s<i.length;s++){var o=i[s].gold_count*n+i[s].bronze_count*e+i[s].silver_count*t;i[s]["score"]=o}i.sort(function(e,t){return t["score"]-e["score"]});for(var s=0;s<i.length;s++){$(".table").append("<tr><td>"+(s+1)+"</td><td>"+i[s]["country_name"]+"</td><td>"+i[s]["gold_count"]+"</td><td>"+i[s]["silver_count"]+"</td><td>"+i[s]["bronze_count"]+"</td><td>"+i[s]["score"]+"</td></tr>")}$(".load").hide();$(".table").show()})})